window.bookSummaryJSON = "<p>He's my boyfriend's father, also my boss, and totally off limits...<br> <br> JJ Kane. Billionaire tycoon. Ruthless villain. Supposed head of the underworld.<br> The first time I set eyes on him, I hated him with a visceral intensity that took me by surprise.</p> <p>Considering he gave me a roof over my head when I had nowhere else to go, I should be grateful.</p> <p>Instead, I can’t seem to stop baiting him.</p> <p>He's also my boyfriend’s father. Twenty-six years older.</p> <p>And all wrong for me.</p> <p>He goes out of his way to avoid me, treats me like I don’t exist, but also gives me a job in his office, and protects me from my boyfriend's anger.</p> <p>Now, he’s also my boss, so I can’t afford to antagonize him.</p> <p>Yet, we can’t seem to stop fighting every time we meet.</p> <p>That is, until he kisses me....</p> <p>This is an enemies to lovers age-gap forbidden romance between an arrogant mean CEO and a strong-willed, confident young woman who’s determined to live life on her own terms. This audiobook is a stand alone.</p> <p><i>*As seen on booktok*</i></p>"; 
